import logo from './logo.svg';
import './App.css';
import "./api.js"

function App() {

  const url = "https://api.twitter.com/2/users/by/username/elonmusk"

  const token = "AAAAAAAAAAAAAAAAAAAAAK86hwEAAAAA3YtRRt4ZycqJe6QN69sn0UDxefQ%3DmrMvx7Y0fPFHYoz3oKsmGnVMx8tcbn1LUkYt9PSsUGgL3INJr0"
  fetch(url, {
    mode: 'no-cors',
    method: "get",
    headers: {
      "Content-Type": "application/json",
      "Authorization": `Bearer ${token}`
    },
    // body: JSON.stringify(ob)
  })
    .then((response) => {
      console.log(response)
    })
    .catch((err) => {
      console.log(err)
    })

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
